import React from 'react';

export function loadWarns(warns) {
    if (warns.length <= 0) {
        return (
            <h1>No Warns</h1>
        )
    } else {
        return (
            <ul>
                {
                    warns.map(warn => {
                        return (
                            <li>
                                <span>{warn.punishmentId}</span>
                            </li>
                        )
                    })
                }
            </ul>
        )
    }
}
